import React, { useState } from 'react'
import { makeStyles } from '@material-ui/core';

const useStyles = makeStyles(theme => ({
    root: {
        '& .MuiFormControl-root': {
            width: '90%',
            margin: theme.spacing(1)
        }
    }
}))

function Form(props) {
    const classes = useStyles();
    return (
        <div>
            <form className={classes.root} autoComplete="off">
                {props.children}
            </form>
        </div>
    )
}

export default Form
